import React from 'react';
import Slider from 'react-slick';
import pinImage from './images/pin.JPEG';
import caveringImage from './images/cavering.JPEG';
import butterflyringImage from './images/butterflyring.JPEG';
import necklesImage from './images/neckles.JPEG';
import bangleImage from './images/bangle.JPEG';


const Home = () => {
  const settings = {
    dots: false,
    infinite: true,
    speed: 1000, 
    slidesToShow: 1, 
    slidesToScroll: 1, 
    autoplay: true, 
    autoplaySpeed: 5000, 
    centerMode: true, 
    centerPadding: '0px', 
  };

  return (
    <div className="home-container">
      <h1><b><i>Home</i></b></h1>
      <Slider {...settings}>
        <div>
          <img src={pinImage} alt="PIN"/>
        </div>
        <div>
          <img src={caveringImage} alt="CAVERING" height={500} width={500}/>
        </div>
        <div>
          <img src={butterflyringImage} alt="BUTTERFLYRING" />
        </div>
        <div>
          <img src={necklesImage} alt="NECKLES" />
        </div>
        <div>
          <img src={bangle} alt="BANGLE" />
        </div>
      </Slider>
    </div>
  );
};

export default Home;
